window.bookSummaryJSON = "<p>This audio collection includes:&nbsp;</p> <p></p> <ul> <li><i>Dinosaurs Before Dark</i>: Jack and his younger sister, Annie, stumble upon a tree house filled with books. Before Jack and Annie can figure out the mystery of the tree house, it whisks them back to the prehistoric past. Now they have to figure out how to get home. Can they do it before dark, or will they be become a dinosaur's dinner?&nbsp;</li> <li><i>The Knight at Dawn</i>: Peacocks for dinner and boys in skirts. That's what Jack and Annie find when the Magic Tree House transports them back to the Middle Ages for another wild adventure. They find themselves in the middle of an enormous castle and can hear the beginnings of a feast underway in the Great Hall. But Jack and Annie aren't exactly welcome guests!&nbsp;</li> <li><i>Mummies in the Morning</i>: Jack and Annie don't need another mummy. But that's what they get when the Magic Tree House whisks them back to ancient Egypt after reading a book on the same subject. There they find themselves in a pyramid face to face with a long dead queen named Hutepi. Will Jack and Annie be able to help her, or will they end up as mummies themselves?&nbsp;</li> <li><i>Pirates Past Noon</i>: It's a veritable treasure trove of trouble when the Magic Tree House carries Jack and Annie back to the days of deserted islands, secret maps, and dangerous pirates! Will they discover the hidden buried treasure, or will they face the possibility of walking the plank?&nbsp;</li> <li><i>Night of the Ninjas</i>: Have you ever met a real live ninja? Jack and Annie do when the Magic Tree House whisks them back to ancient Japan in search of enchantress Morgan le Fay. When they arrive, they find themselves in the cave of a ninja master. Will they learn the secrets of the ninja? Or will the evil samurai warriors get them first?&nbsp;</li> <li><i>Afternoon on the Amazon</i>: Vampire bats and killer ants? That's what Jack and Annie are about to run into when the Magic Tree House whisks them back in time to a South American rain forest in search of the elusive Morgan le Fay. It's not long before they get hopelessly lost on the Amazon River. Will they be able to find their way back to the tree house before they are trampled by stampeding killer ants?&nbsp;</li> <li><i>Sunset of the Sabertooth</i>: The Ice Age is very cool...for two kids in bathing suits! Jack and Annie nearly freeze when the Magic Tree House whisks them back into the time of cave people and woolly mammoths. But nothing can stop them from having another wild adventure - not even a sabertooth tiger!&nbsp;</li> <li><i>Midnight on the Moon</i>: Three...two...one...blast off! The Magic Tree House whisks Jack and Annie off to the moon - and the future. Their mission? To find the last \"M\" thing that will free Morgan from the spell. Can they do it before the air in their oxygen tank runs out? Will the mysterious moon man help them? And why is Peanut the mouse acting so strange?&nbsp;</li> </ul>"; 
